(89, 'Somehow I Manage:                                                                     Student Engagement & Social Emotional Learning                                                                                                      ', 'All', NULL, 'ALL', 'In this session, participants will learn tips and techniques to incorporate movement and exercise into the core curriculum.  These activities will make learning more enjoyable and fun while still focusing on student objectives. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Eric Pawlowski', '', 'Virtual Platform', 'K-4', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(90, 'Creating a Virtual Bitmoji Classroom                                           ', 'All', NULL, 'ELA', 'In this interactive session, participants will learn how to create a Virtual Bitmoji Classroom in Google Slides to enhance the joy and interest of reading. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Danielle D\'Adamo', '', 'Virtual Platform', 'K-2', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(91, 'Maximizing Student Engagement In The Classroom                    ', 'All', NULL, 'ALL', 'In this session, participants will learn new strategies and collaborate with their colleagues on how to effectively promote and maximize student engagement in the classroom. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Teneita Palmer', '', 'Virtual Platform', 'Pre-K', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(92, 'Children in DiSTRESS: “Creative” Coping Strategies - Art & Play Therapy Techniques for the Preschool Classroom                   ', 'All', NULL, 'Special Education', 'In this session, participants will examine the causes, warning signs, physical/behavioral symptoms, and ways to alleviate childhood stress. Participants will learn how to embed “art and play therapy techniques” to engage children in individual, small group and large group “therapeutic activities” within the Highscope framework. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Valerie Bostory', '', 'Virtual Platform', 'Pre-K', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(93, 'Edwin Wargo: Creating Breakout Boxes & Escape Rooms with Google Forms (Beginner)', '20', 'null', 'All', 'Breakout Boxes and Escape Rooms are instructional tools that can really engage students in curricular content, using not just recall, but assimilation and logic. Students can work through them independently or collaboratively, remotely or in class. This session will guide participants through creating Breakout Boxes and Escape Rooms for students. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Edwin Wargo', '', 'Virtual Platform', 'PreK- 12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-29', '2020-04-01', 'active', '2021-03-29 11:48:53', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
