(96, 'Have No Fear: Student Engagement Strategies are Here! ', 'All', NULL, 'All', 'In this session, participants will learn how to incorporate various platforms, programs, and techniques to engage their students during virtual learning. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Melissa Regenthal', '', 'Virtual Platform', '6-8', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
