(99, 'Engaging Social Emotional Resources for Young Learners                         ', 'All', NULL, 'ALL', 'In this session, participants will learn how to embed essential social/emotional lessons into the preschool daily routine, both in-person and online.  This will be achieved by utilizing literacy-based activities that engage young learners and foster a positive classroom climate. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Cynthia Thompson', '', 'Virtual Platform', 'Pre-K', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(100, 'Using Mindfulness and Critical Literacy to Teach SEL in the Classroom                                                                                      ', 'All', NULL, 'ELA', 'In this session, participants will discuss best practice strategies in order to effectively implement social emotional learning that sparks mindfulness, self awareness, and empathy in the classroom. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Deborah Bartley-Carter', '', 'Virtual Platform', '6-8', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(101, 'The Heart of Your Classroom: Social & Emotional Learning ', 'All', NULL, 'All', 'This workshop will give participants the social and emotional tools and resources necessary for in person or virtual learning using the COR Assessment, state standards, and common sense early childhood teaching as a framework. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.)  ', 'Brooke Noonan', '', 'Virtual Platform', 'K-2', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(102, 'Super Strategies for Social Emotional Learning                                ', 'All', NULL, 'All', 'In this session, participants will discover how to deliver social emotional learning lessons in an engaging and effective way. Participants will explore social emotional learning resources that are available through the Special Education Department. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Sean Healy', '', 'Virtual Platform', '6-8', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(103, 'Using G Suite Apps in the Mathematics Classroom                                     ', 'All', NULL, 'Math', 'In this session, participants will learn how to integrate G Suite apps and extensions in the mathematics classroom. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Renzo Arevalo', '', 'Virtual Platform', '9-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(104, 'Enhancing Student Engagement Using Go Formative                           ', 'All', NULL, 'Science', 'In this session, participants will learn how to make use of the Goformative platform, which provides teachers with the ability to provide synchronous/asynchronous support and track student progress on assignments - on ANY device. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Jeremy Stanton', '', 'Virtual Platform', '9-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(105, 'Creating Interactive Sound Card Slides                                             ', 'All', NULL, 'ELA', 'In this interactive session, participants will have the opportunity to create Sound Card Slides that can be utilized during small group instruction to enhance student engagement. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Jasmine McTague', '', 'Virtual Platform', 'K-2', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(106, 'Edwin Wargo: Data Flow from Google Quizzes to Google Classroom to Genesis to Students to Parents ', '20', 'null', 'All', 'In this session participants will become more efficient with data. We will map the flow of data from Google Quizzes to Classroom and explore the possibilities of getting it into Infinite Campus. We will explore the apps and methods within the respective Google Apps. Sharing data with students and parents will also be discussed. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Edwin Wargo', '', 'Virtual Platform', 'PreK-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-29', '2020-04-01', 'active', '2021-03-29 11:49:19', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(107, 'Edwin Wargo: Engaging Instruction & Secure Practices with Google Meets ', '20', 'null', 'All', 'Google Meets has gone from a basic video conferencing tool to a fairly sophisticated instructional tool. What\'s more, Google has announced some exciting changes for Meets. This session will highlight those changes and what they mean to you and your students. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Edwin Wargo', '', 'Virtual Platform', 'PreK-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-29', '2020-04-01', 'active', '2021-03-29 11:49:35', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(108, 'Hook Your Students With Hybrid Best Practice Strategies', 'All', NULL, 'ELA', 'In this session, participants will learn effective best practice engagement strategies that include surveys, small group instruction, choice boards, exit tickets, and project based learning. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Janice Alvarez', '', 'Virtual Platform', '3-5', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(109, 'Student Engagement in an Active Classroom: Protocols and Strategies for Collaboration', 'All', NULL, 'ELA', 'In this session, participants will learn how to capture student engagement using strategies and protocols for small group instruction that can be used for remote or hybrid instruction. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Jennifer Sanchez', '', 'Virtual Platform', '6-8', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(110, 'Edwin Wargo: Comments, Writing Templates, and Prompts and Classroom', '20', 'null', 'ALL ', 'This course will have a laser focus on making assignments more interactive and allow participants to give feedback. We will look at how to add comments to student work, add rubrics, and create prompts/templates using Docs and Slides. There will be an emphasis on adding templates/prompts to Classroom. Classroom tools such as originality reports will also be highlighted. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Edwin Wargo', '', 'Virtual Platform', 'K-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-29', '2020-04-01', 'active', '2021-03-29 11:49:46', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(111, 'How to Conduct Successful Break Out Rooms', 'All', NULL, 'Math', 'In this interactive session, participants will learn how to effectively utilize breakout rooms to maximize student participation and engagement. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Avneet Kaur', '', 'Virtual Platform', '6-8', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(112, 'Energetic Engagement Ideas for Preschoolers', 'All', NULL, 'All ', 'In this session, participants will learn how to engage preschoolers, by utilizing props, visual aides, interactive google slides, games, songs, and fingerplays. Participants will learn strategies for keeping preschoolers engaged during transitions for both virtual and in-person learning. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Jacqui Gross', '', 'Virtual Platform', 'Pre-K', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(113, 'Edwin Wargo: Student Engagement with Instructional Design using Google', '20', 'null', 'ALL ', 'Instructional design research meets Google Apps in this course. Instructional design is a field of study about effectively teaching and learning online (remote learning). As we\'ve seen, what works in the classroom doesn\'t always translate well into online learning. Teachers will see how to practically implement best instructional design practices in Google Apps - Classroom, Docs, Forms/Quizzes, Meet, etc. Topics like instructions, cognitive load, feedback, and quizzes will be demonstrated in Google Apps with a focus on Instructional Design best practices. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Edwin Wargo', '', 'Virtual Platform', 'K-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-29', '2020-04-01', 'active', '2021-03-29 11:49:58', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(114, 'Engaging Students in the ELA Classroom', 'All', NULL, 'ELA', 'In this session, participants will be introduced to simple, research-based strategies that will assist in creating a classroom environment that encourages all students to engage in learning. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Sara Valentino', '', 'Virtual Platform', '9-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(115, 'Social-Emotional Development in Preschool', 'All', NULL, 'ALL ', 'In this session, participants will learn why it is important to incorporate social emotional learning. In addition, it will focus on core skills, problem solving, resiliency, empathy and self regulation activities to bring SEL into the classroom. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Diana Heyward-Bowden', '', 'Virtual Platform', 'Pre-K', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(116, 'Supporting Social Emotional Development for Our Youngest Learners', 'All', NULL, 'ALL ', 'In this session, participants will expand their knowledge of Social Emotional Learning. Participants will receive resources for literature, apps, and small group activities that may be used in the classroom. The resources can also be shared with families for use at home. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Tiffany Grant-Simmons', '', 'Virtual Platform', 'Pre-K', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
