(121, 'Pear Deck for 100% Student Engagement ', '20', 'null', 'ALL', 'In this session, participants willi explore the expansive capabilities of Pear Deck for in-person, hybrid, and remote learning with solutions rooted in active learning and formative assessment. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Adam Lindstrom', '', 'Virtual Platform', 'K-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-30', '2020-04-01', 'active', '2021-03-30 22:15:34', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(122, 'Edwin Wargo: Google Forms and Quizzes', '20', 'null', 'ALL', 'This course will focus on how to create, share, and have Google quizzes automatically grade student assessments. Creating questions, viewing assessment data, limiting responses, and storing data will be highlighted. Adding Quizzes and grades to Google Classroom will be discussed. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Edwin Wargo', '', 'Virtual Platform', 'Pre-K -12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-29', '2020-04-01', 'active', '2021-03-29 11:50:11', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(123, 'Books! The Perfect Tool to Enhance Children\'s Social-Emotional Development', 'All', NULL, 'ALL', 'Sometimes it seems as if our little ones can be an emotional roller coaster! There are lots of big feelings and relationships with highs and lows, twists and turns.  In this session, participants will be provided books that are the perfect tool to engage and inspire children with stories that address social-emotional concepts. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Jaquie Louison', '', 'Virtual Platform', 'K-2 ', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:04:03', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(124, 'Student Connections Beyond Any Classroom ', '20', 'null', 'ALL', 'In this session, teachers will learn how to build and support an environment for social emotional learning through the observation of five non-cognitive skills and implementation of social emotional activities to support growth in these skills. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Tynetta Harris, Supervisor', '', 'Virtual Platform', '9-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:30:21', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(125, 'Mindfulness, Meditation, and Movement: SEL Strategies for High School Students', '20', 'null', 'ELA', 'In this session, teachers will learn how to incorporate mindful moments into their daily classroom routine to engage students and address their need for social emotional learning. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Emily Quinn', '', 'Virtual Platform', '9-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:31:58', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(126, 'Edwin Wargo: Jamming with Jamboard', '20', 'null', 'ALL', 'Google Jamboard is an exciting, interactive app that has gained popularity during remote instruction. It allows for awesome interactive instructional content to engage students in all subject areas. This course will walk through using Jamboards remotely, in Google Meets, and in Google Classroom. By the end,participants will be comfortable creating Jamboards and gain confidence using them in their classes. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Edwin Wargo', '', 'Virtual Platform', 'Pre-K -12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-29', '2020-04-01', 'active', '2021-03-29 11:50:26', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(127, 'Rigor and Relevance of Google Slides and Docs: Complementing PBL for Presentations and Research Papers', '20', 'null', 'ELA', 'In this session, participants will learn how Google Slides and Docs can be used to enhance project-based learning activities.(Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Adnan Ezad', '', 'Virtual Platform', '9-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:27:43', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(128, 'Mastering Google Forms: Creating Forms that Do More Than You Imagined!', '20', 'null', 'Math', 'Participants will learn how to create Google Forms that self grade, allow for reinforcement, and automated differentiation for students. Also, bonus material on how to easily create Escape Rooms and Solve & Check Forms for small group activities. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Patricia Hudak', '', 'Virtual Platform', '6-8', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:31:35', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(129, 'HoliYoga; “Relax, Refresh, Rebound”\n', '20', 'null', 'All', 'In this lesson, teachers will be taught how to teach their students how to relax, refresh and rebound through meditation/mindfulness and yoga techniques. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Isaac Holiday', '', 'Virtual Platform', '9-12', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:30:05', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(130, 'Exploring Cross Curricular Writing', '20', 'null', 'ELA', 'In this session, participants will learn how to utilize Google Apps in order to produce quality projects for content areas such as writing, social studies, and science. (Please note participants may register for a maximum of two sessions. If participants register for additional sessions they will be removed at the committee\'s discretion.) ', 'Maureen Betz', '', 'Virtual Platform', '3-5', '', 'Spring into Learning', 'test', 'online', 'Zoom', '2021-03-26', '2020-04-01', 'active', '2021-03-26 00:32:19', 25693, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
