(163, 'Factors that Impact Decision Making of School Administrators Regarding Technology Purchases', '18', '', 'Administration', 'The purpose of this study was to explore how and why school-based administrators make decisions regarding technology. To get a better understanding various decision-making theories are explored. Dr. Mattaliano will discuss his findings as well as provide supports that will benefit all technology decision-makers as they navigate the challenges of providing access to teachers and students as we move forward through this new educational landscape.\n', 'Dr. Peter Mattaliano', 'pmattaliano@jcboe.org', 'MS 7', 'Administrators', 'K-12', 'Fall Series 1', 'test', 'offline', 'Franklin L. Williams MS 7', '2021-08-27', '2021-08-31', 'active', '2021-08-30 13:42:44', 18212, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(164, 'TRANSFORMING SCHOOL-WIDE PROFESSIONAL DEVELOPMENT USING CULTURALLY RELEVANT PEDAGOGY  TO ENGAGE BLACK BOYS IN LITERACY', '18', 'undefined', 'Administration', 'This mixed-research study used Improvement Science to understand the problem of underachieving and underperforming in literacy for middle school Black boys. Two primary drivers were identified: 1) professional development for high-quality literacy practices and 2)  culturally relevant pedagogy.', 'Dr. Rosalyn Barnes', 'rbarnes1@jcboe.org', 'MS 7', '', '', 'Fall Series 2', 'test', 'offline', 'In-person presentation', '2021-08-27', '2021-08-31', 'active', '2021-08-30 13:43:30', 18212, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
(165, 'An Investigation of Elementary Pre-service and In-service Teachers’ Preparedness to Educate Culturally and Linguistically Diverse Populations in Northern New Jersey Schools', '18', 'undefined', 'Administration', 'An Investigation of Elementary Pre-service and In-service Teachers’ Preparedness to Educate\nCulturally and Linguistically Diverse Populations in Northern New Jersey Schools explores\nteachers’ perceptions of their preparedness to educate Culturally and Linguistically Diverse\npopulations in three key areas. These areas include Curriculum and Instruction, Relationships\nwith Parents, Guardians, and Students, and Creating a Warm, Supportive and Caring\nEnvironment. Teacher training in CLD may contribute to teachers’ preparedness to create CLD\ncurricula adaptations, establish positive relationships with community members, and create a\nsense of group belonging in America’s classrooms. More importantly, Culturally Responsive\nteachers may lessen the achievement gaps within diverse populations.\n', 'Dr. Cleopatra J. Wingard', '', 'MS7', 'Administrators', '', 'Fall Series 3', 'test', 'offline', 'undefined', '2021-08-27', '2021-08-31', 'active', '2021-08-30 13:44:09', 18212, '2023-07-03 04:27:56', '2023-07-03 04:27:56', NULL),
